import React, { useState, useEffect } from 'react';
import './style.css'

const CarDesc = (props) => {
  const [modelName, setBrand] = useState([]);
  const [selectedValue, setSelectedValue] = useState(0)

  const handleChange = (e) => {
    setSelectedValue(e.target.value)

  }
   useEffect(() => {

  fetch(
    `http://uimocks.infoedge.com/vehicles.json`,
    {
      method: "GET",    
    },    
  )
    .then(res => res.json())
    .then(response => {
       setBrand(response);
    })
    .catch(error => console.log(error));
});

	return (
		<React.Fragment>

        {modelName.map((modelName, index) => (
       ((props.brand == modelName.make) && (props.model == modelName.model) ) && <div
       key={index}

        >
             <div>{modelName.make}</div>
           <div>{modelName.model}</div>
           <div>{modelName.enginePowerPS}</div>
           <div>{modelName.enginePowerKW}</div>
           <div>{modelName.fuelType}</div>
           <div>{modelName.bodyType}</div>
           <div>{modelName.engineCapacity}</div>
        </div>
      ))}



		</React.Fragment>
	)
}

export default CarDesc;
